window.bookSummaryJSON = "<p><b>DS Whitney Walker wants a promotion, but it’s hard when she’s trying to balance motherhood with a career. </b></p> <p>When a newborn baby is kidnapped from the local hospital, she draws on her skills as a mother to help. Despite being ordered not to, and when the leads are going nowhere, Walker enlists the help of a local journalist who’s convinced it’s the work of an international baby smuggling ring. Walker’s plan backfires and she fears they’re running out of time.</p>"; 
